INSERT INTO `dpm_t_top_news` VALUES ('EJohnson','GENERAL PRACTICE','Bayer Healthcare to acquire Pathway Medical Technologies',NULL,'Bayer HealthCare announced today that its affiliate, MEDRAD, Inc. has acquired Pathway Medical Technologies, Inc., of Kirkland, Wash. Financial terms of the agreement were not disclosed. With this acquisition, Bayer HealthCare is strengthening its MEDRAD Interventional business by expanding its presence in the field of vascular intervention technologies.'),('EJohnson','GENERAL PRACTICE','Pharam-X FDA approval',NULL,'Pharma-X today announced it has received U.S. Food and Drug Administration (FDA) approval for the RX Product-X Renal Stent System for the treatment of renal artery stenosis (narrowing of the main arteries supplying blood to the kidneys) in patients with uncontrolled hypertension (high blood pressure). Over time, narrowed kidney arteries can lead to kidney failure and increased risk of heart disease, stroke and peripheral artery disease. This approval is supported by the Product-X-Apex study, which demonstrated that RX Product-X is safe and effective in patients with renal artery stenosis and uncontrolled hypertension. '),('FRoberston','CARDIOVASCULAR DISEASE','ACCF Interactive Study Session for Maintenance of Certification Cardiovascular Disease Updates 2010 ',NULL,'Make the most of your time in Chicago with this optional program. Learn in an interactive environment as ABIM-certified physician experts lead you through the 50 case-based questions (25 questions per module, 2 modules) that comprise ABIM’s Cardiovascular Disease Updates 2010 and 2011 medical knowledge modules. This study session offers an opportunity to weigh the evidence on a case-by-case basis as you discuss the options with our faculty and your fellow participants to identify the most appropriate answers to the ABIM questions.'),('FRoberston','CARDIOVASCULAR DISEASE','Pharam-X FDA approval',NULL,'Pharma-X today announced it has received U.S. Food and Drug Administration (FDA) approval for the RX Product-X Renal Stent System for the treatment of renal artery stenosis (narrowing of the main arteries supplying blood to the kidneys) in patients with uncontrolled hypertension (high blood pressure). Over time, narrowed kidney arteries can lead to kidney failure and increased risk of heart disease, stroke and peripheral artery disease. This approval is supported by the Product-X-Apex study, which demonstrated that RX Product-X is safe and effective in patients with renal artery stenosis and uncontrolled hypertension. '),('FRoberston','CARDIOVASCULAR DISEASE','Roche’s Tarceva receives European approval for first-line use in a genetically distinct type of lung',NULL,'Roche (SIX: RO, ROG; OTCQX: RHHBY) announced that the European Commission has approved Tarceva® (erlotinib) for use in patients with a genetically distinct type of non-small cell lung cancer (NSCLC) in Europe. This approval will enable the use of Tarceva as a first-line monotherapy in people with locally advanced or metastatic NSCLC with EGFR (epidermal growth factor receptor) activating mutations. Tumours with these mutations are responsive to Tarceva(1) and treatment with this medicine has been shown to more than triple the number of patients whose tumours shrink (response rate). Tarceva has also shown to nearly double the time patients live without their disease progressing (progression free survival - PFS) compared to chemotherapy.(2,3) ');
/*!40000 ALTER TABLE `dpm_t_top_news` ENABLE KEYS */;
UNLOCK TABLES;

