and parent_active_flag = coalesce(p_parent_active_flag ,parent_active_flag )
and child_active_flag = coalesce(p_child_active_flag ,child_active_flag )

ORDER BY 
parent_concept_display,
parent_concept_code,
sort_level,
child_concept_display,
child_concept_code;

