/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `DPM_UP_MEMBER_LOGIN`( pLogin varchar(31), pPword varchar(255) )
BEGIN

SELECT m.* , v.profile_id, v.profile_name
        
FROM DPM_V_MEMBER as m
        left join DPM_V_MEMBER_PROFILE as v
            on m.member_id = v.member_id 
            and v.profile_active_flag = 1
            and v.member_profile_active_flag = 1
WHERE 1=1
and m.login = pLogin
and BINARY  m.pword= pPword
and m.member_active_flag = 1
;

END */;;
