begin

DECLARE vCheck int;
SELECT count(*) INTO vCheck FROM DPM_T_PRODUCT WHERE product_id = p_product_id;

IF vCheck = 0 THEN /*insert*/
   IF ISNULL(p_product_id) THEN
   	  set p_product_id = getTablekey('DPM_T_PRODUCT');
   END IF;
    
   insert into DPM_T_PRODUCT ( product_id, company_id, product_name, product_desc, product_code, active_flag, sort, product_logo )
   values ( coalesce( p_product_id , null ),coalesce( p_company_id , null ),coalesce( p_product_name , null ),coalesce( p_product_desc , null ),coalesce( p_product_code , null ),coalesce( p_active_flag , null ),coalesce( p_sort , null ),coalesce( p_product_logo , null ) );

ELSE /*update*/
	update DPM_T_PRODUCT
	set 
company_id =  coalesce( p_company_id, company_id ),
product_name =  coalesce( p_product_name, product_name ),
product_desc =  coalesce( p_product_desc, product_desc ),
product_code =  coalesce( p_product_code, product_code ),
active_flag =  coalesce( p_active_flag, active_flag ),
sort =  coalesce( p_sort, sort ),
product_logo =  case when p_product_logo_TN = 1 then null else coalesce( p_product_logo, product_logo ) end
	where product_id = p_product_id;
END IF;


select p_product_id as product_id;

END */;;
